		var curPage = 1;
		var maxPage = rows.last().attr('data-page');

		function showRows (_pageID) {
			rows.hide();
			rows.filter('[data-page="' + _pageID + '"]').show();

			prev.removeClass('is-disabled');
			next.removeClass('is-disabled');

			if (_pageID == 1)
				prev.addClass('is-disabled');

			if (_pageID == maxPage)
				next.addClass('is-disabled');
		}

		showRows (curPage);

		prev.on('click', function (e) {
			e.preventDefault();

			curPage -= 1;

			showRows (curPage);
		});

		next.on('click', function (e) {
			e.preventDefault();

			curPage += 1;

			showRows (curPage);
		});
